    async startTargetHTTPServer(port, protocol) {
        return new Promise((resolve, reject) => {
            const server = http.createServer((req, res) => {
                const response = {
                    message: `HTTP relay test successful via ${protocol.toUpperCase()}`,
                    protocol: protocol,
                    url: req.url,
                    timestamp: new Date().toISOString(),
                    server: `target-${protocol}`,
                    headers: req.headers
                };

                res.writeHead(200, {
                    'Content-Type': 'application/json',
                    'X-Protocol': protocol,
                    'X-Server': `target-${protocol}`
                });
                res.end(JSON.stringify(response, null, 2));

                console.log(`[TARGET-${protocol.toUpperCase()}] ${req.method} ${req.url}`);
            });

            server.listen(port, '127.0.0.1', (err) => {
                if (err) {
                    reject(err);
                } else {
                    console.log(`  Target HTTP server listening on http://127.0.0.1:${port}`);
                    this.currentProcesses.push({ type: 'http-server', server });
                    resolve(server);
                }
            });

            server.on('error', reject);
        });
    }

