        return {
            success: successCount === tests.length,
            successCount: successCount,
            totalCount: tests.length,
            avgLatency: avgLatency,
            tests: results
        };
    }

    async makeHTTPRequest(port, path, protocol, timeout = 10000) {
        const startTime = process.hrtime.bigint();

        return new Promise((resolve) => {
            const options = {
                hostname: '127.0.0.1',
                port: port,
                path: path,
                method: 'GET',
                timeout: timeout,
                headers: {
                    'X-Test-Protocol': protocol,
                    'User-Agent': `hyper-nat-test/${protocol}`
                }
            };

            console.log(`    Making request to http://127.0.0.1:${port}${path}`);

            const req = http.request(options, (res) => {
                let data = '';
                res.on('data', (chunk) => { data += chunk; });
                res.on('end', () => {
                    const endTime = process.hrtime.bigint();
                    const latency = Number(endTime - startTime) / 1000000; // Convert to milliseconds

                    try {
                        const responseData = JSON.parse(data);
                        resolve({
                            success: res.statusCode === 200,
                            statusCode: res.statusCode,
                            data: responseData,
                            latency: latency,
                            size: data.length
                        });
                    } catch (parseError) {
                        resolve({
                            success: false,
                            error: `Response parse error: ${parseError.message}`,
                            statusCode: res.statusCode,
                            latency: latency,
                            rawData: data.substring(0, 200) + (data.length > 200 ? '...' : '')
                        });
                    }
                });
            });

            req.on('error', (error) => {
                const endTime = process.hrtime.bigint();
                const latency = Number(endTime - startTime) / 1000000;
                resolve({
                    success: false,
                    error: `Request error: ${error.message}`,
                    latency: latency
                });
            });

            req.on('timeout', () => {
                req.destroy();
                const endTime = process.hrtime.bigint();
                const latency = Number(endTime - startTime) / 1000000;
                resolve({
                    success: false,
                    error: 'Request timeout',
                    latency: latency
                });
            });

            req.end();
        });
    }

    async cleanupProcesses() {
        console.log(`  Cleaning up ${this.currentProcesses.length} processes...`);

        for (const proc of this.currentProcesses) {
