    async testProtocolMode(protocol) {
        console.log(`\n=== Testing ${protocol.toUpperCase()} Mode ===`);

        const serverPort = this.basePort + this.getProtocolOffset(protocol);
        const clientPort = this.relayPort + this.getProtocolOffset(protocol);
