        let httpServer = null;
        let relayServer = null;
        let relayClient = null;

        try {
            // 1. Start HTTP test server
            console.log(`Starting HTTP server on port ${serverPort}...`);
            httpServer = await this.startHTTPServer(serverPort, protocol);
            await this.sleep(1000);

            // 2. Start relay server
            console.log(`Starting ${protocol} relay server...`);
            const publicKey = await this.startRelayServer(serverPort, protocol, secret);
            await this.sleep(2000);

            // 3. Start relay client
            console.log(`Starting ${protocol} relay client...`);
            await this.startRelayClient(clientPort, protocol, publicKey);
            await this.sleep(2000);

            // 4. Run HTTP tests through relay
            console.log(`Running HTTP tests through ${protocol} relay...`);
            const testResults = await this.runHTTPTests(clientPort, protocol);

            // 5. Store results
            this.testResults.push({
                protocol: protocol,
                serverPort: serverPort,
                clientPort: clientPort,
                results: testResults,
                timestamp: Date.now()
            });

            console.log(`${protocol.toUpperCase()} mode tests completed successfully`);

