                serverPort: serverPort,
                clientPort: clientPort,
                results: { error: error.message },
                timestamp: Date.now()
            });
        } finally {
            // Cleanup this test's processes
            if (httpServer) {
                console.log(`Stopping HTTP server for ${protocol}...`);
                httpServer.kill('SIGINT');
            }

            // Give processes time to shutdown gracefully
            await this.sleep(2000);

            // Force kill any remaining processes for this test
            this.processes.forEach(proc => {
                if (proc && !proc.killed) {
                    proc.kill('SIGKILL');
                }
            });
            this.processes = [];
        }
