    async startHTTPServer(port, mode) {
        return new Promise((resolve, reject) => {
            const server = spawn('node', ['http-test-server.js', port.toString(), mode], {
                cwd: '/mnt/c/dev/hyper-nat',
                stdio: ['pipe', 'pipe', 'pipe']
            });

            server.stdout.on('data', (data) => {
                const output = data.toString();
                console.log(`[HTTP-${mode}] ${output.trim()}`);
                if (output.includes('HTTP Test Server') && output.includes('running')) {
                    resolve(server);
                }
            });

            server.stderr.on('data', (data) => {
                console.error(`[HTTP-${mode}-ERR] ${data.toString().trim()}`);
            });

            server.on('error', reject);
            server.on('exit', (code) => {
                if (code !== 0) {
                    console.log(`[HTTP-${mode}] Server exited with code ${code}`);
                }
            });

            this.processes.push(server);

            // Timeout after 5 seconds
            setTimeout(() => {
                reject(new Error(`HTTP server startup timeout for ${mode}`));
            }, 5000);
        });
    }

    async startRelayServer(targetPort, protocol, secret) {
        return new Promise((resolve, reject) => {
            const server = spawn('node', ['index.js', 'server', '-p', targetPort.toString(), '--protocol', protocol, '-s', secret], {
                cwd: '/mnt/c/dev/hyper-nat',
                stdio: ['pipe', 'pipe', 'pipe']
            });

            let publicKey = null;

            server.stdout.on('data', (data) => {
                const output = data.toString();
                console.log(`[RELAY-SRV-${protocol}] ${output.trim()}`);

                // Extract public key from command output
                const keyMatch = output.match(/npx hyper-nat client[^-]*-k\s+([A-Za-z0-9]+)/);
                if (keyMatch && !publicKey) {
                    publicKey = keyMatch[1];
                    resolve(publicKey);
                }
            });

            server.stderr.on('data', (data) => {
                console.error(`[RELAY-SRV-${protocol}-ERR] ${data.toString().trim()}`);
            });

            server.on('error', reject);
            server.on('exit', (code) => {
                if (code !== 0) {
                    console.log(`[RELAY-SRV-${protocol}] Server exited with code ${code}`);
                }
            });

            this.processes.push(server);

            // Timeout after 10 seconds
            setTimeout(() => {
                reject(new Error(`Relay server startup timeout for ${protocol}`));
            }, 10000);
        });
