    async httpRequest(port, path, description) {
        const startTime = process.hrtime.bigint();

        return new Promise((resolve, reject) => {
            const options = {
                hostname: '127.0.0.1',
                port: port,
                path: path,
                method: 'GET',
                timeout: 10000
            };

            const req = http.request(options, (res) => {
                const endTime = process.hrtime.bigint();
                const latency = Number(endTime - startTime) / 1000000; // Convert to milliseconds

                let data = '';
                res.on('data', (chunk) => {
                    data += chunk;
                });

                res.on('end', () => {
                    try {
                        const responseData = JSON.parse(data);
                        resolve({
                            success: true,
                            description: description,
                            statusCode: res.statusCode,
                            headers: res.headers,
                            data: responseData,
                            latency: latency,
                            size: data.length,
                            timestamp: Date.now()
                        });
                    } catch (parseError) {
                        resolve({
                            success: false,
                            description: description,
                            error: `JSON parse error: ${parseError.message}`,
                            rawData: data,
                            latency: latency,
                            statusCode: res.statusCode
                        });
                    }
                });
            });

            req.on('error', (error) => {
                const endTime = process.hrtime.bigint();
                const latency = Number(endTime - startTime) / 1000000;

                resolve({
                    success: false,
                    description: description,
                    error: error.message,
                    latency: latency,
                    timestamp: Date.now()
                });
            });

            req.on('timeout', () => {
                req.destroy();
                const endTime = process.hrtime.bigint();
                const latency = Number(endTime - startTime) / 1000000;

                resolve({
                    success: false,
                    description: description,
                    error: 'Request timeout',
                    latency: latency,
                    timestamp: Date.now()
                });
            });

            req.end();
        });
    }

    analyzeLatencyTests(tests) {
        const successfulTests = tests.filter(t => t.success);
        const latencies = successfulTests.map(t => t.latency);

        if (latencies.length === 0) {
            return {
                success: false,
                error: 'No successful latency tests',
                count: tests.length
            };
        }

        latencies.sort((a, b) => a - b);

        return {
            success: true,
            count: latencies.length,
            min: latencies[0],
            max: latencies[latencies.length - 1],
            avg: latencies.reduce((sum, val) => sum + val, 0) / latencies.length,
            median: latencies[Math.floor(latencies.length / 2)],
            p95: latencies[Math.floor(latencies.length * 0.95)],
            p99: latencies[Math.floor(latencies.length * 0.99)],
            all: latencies
        };
    }

    calculateSummary(tests) {
        let successCount = 0;
        let totalTests = 0;
        let totalLatency = 0;
        let totalSize = 0;

        Object.values(tests).forEach(test => {
            if (test.success !== undefined) {
                totalTests++;
                if (test.success) {
                    successCount++;
                    totalLatency += test.latency || 0;
                    totalSize += test.size || 0;
                }
            } else if (test.count) {
                // Latency test summary
                totalTests += test.count;
                successCount += test.success ? test.count : 0;
                totalLatency += test.success ? (test.avg * test.count) : 0;
            }
        });

        return {
            successRate: totalTests > 0 ? (successCount / totalTests) * 100 : 0,
            averageLatency: successCount > 0 ? totalLatency / successCount : 0,
            totalDataTransferred: totalSize,
            testsRun: totalTests,
            testsSuccessful: successCount
        };
    }

