    drawConclusions() {
        const conclusions = [];
        const comparison = this.compareProtocols();
        const protocols = Object.keys(comparison);

        if (protocols.length < 2) {
            return ['Insufficient data for protocol comparison'];
        }

        // Success rate comparison
        const successRates = protocols.map(p => ({ 
            protocol: p, 
            rate: comparison[p].successRate 
        })).sort((a, b) => b.rate - a.rate);

        if (successRates.length > 0) {
            conclusions.push(`Protocol reliability ranking: ${successRates.map(s => `${s.protocol} (${s.rate.toFixed(1)}%)`).join(' > ')}`);
        }

        // Latency comparison
        const latencies = protocols.map(p => ({ 
            protocol: p, 
            latency: comparison[p].averageLatency 
        })).sort((a, b) => a.latency - b.latency);

        if (latencies.length > 0 && latencies[0].latency > 0) {
            conclusions.push(`Latency ranking (fastest first): ${latencies.map(l => `${l.protocol} (${l.latency.toFixed(2)}ms)`).join(' < ')}`);
        }

        // Protocol-specific observations
        if (comparison.tcpudp && comparison.udp) {
            const tcpudpLatency = comparison.tcpudp.averageLatency;
            const udpLatency = comparison.udp.averageLatency;

            if (tcpudpLatency > 0 && udpLatency > 0) {
                const improvement = ((udpLatency - tcpudpLatency) / udpLatency) * 100;
                if (improvement > 5) {
                    conclusions.push(`TCPUDP shows ${improvement.toFixed(1)}% latency improvement over UDP`);
                } else if (improvement < -5) {
                    conclusions.push(`TCPUDP shows ${Math.abs(improvement).toFixed(1)}% latency increase over UDP`);
                } else {
                    conclusions.push('TCPUDP and UDP show similar latency characteristics');
                }
            }
        }

        return conclusions;
    }

