    async runHTTPTests(port, protocol) {
        const testData = crypto.randomBytes(64).toString('hex');

        try {
            // Test health endpoint
            const healthResult = await this.httpRequest(port, '/health');
            if (!healthResult.success) {
                throw new Error('Health check failed: ' + healthResult.error);
            }

            // Test echo endpoint with data integrity
            const echoResult = await this.httpRequest(port, `/echo?data=${testData}`);
            if (!echoResult.success) {
                throw new Error('Echo test failed: ' + echoResult.error);
            }

            // Verify data integrity
            const echoData = echoResult.data;
            const dataIntegrityOk = echoData.request && echoData.request.testData === testData;
            const hasIntegrityHash = echoData.integrity && echoData.integrity.dataHash;

            // Test latency
            const latencyResult = await this.httpRequest(port, '/latency');
            if (!latencyResult.success) {
                throw new Error('Latency test failed: ' + latencyResult.error);
            }

            return {
                success: true,
                protocol: protocol,
                latency: healthResult.latency,
                dataIntegrity: dataIntegrityOk && hasIntegrityHash,
                tests: {
                    health: healthResult,
                    echo: echoResult,
                    latency: latencyResult
                }
            };

        } catch (error) {
            return {
                success: false,
                protocol: protocol,
                error: error.message
            };
        }
    }

    async httpRequest(port, path, timeout = 5000) {
        const startTime = process.hrtime.bigint();

        return new Promise((resolve) => {
            const options = {
                hostname: '127.0.0.1',
                port: port,
                path: path,
                method: 'GET',
                timeout: timeout
            };

            const req = http.request(options, (res) => {
                let data = '';
                res.on('data', (chunk) => { data += chunk; });
                res.on('end', () => {
                    const endTime = process.hrtime.bigint();
                    const latency = Number(endTime - startTime) / 1000000;

                    try {
                        const responseData = JSON.parse(data);
                        resolve({
                            success: true,
                            statusCode: res.statusCode,
                            data: responseData,
                            latency: latency,
                            size: data.length
                        });
                    } catch (parseError) {
                        resolve({
                            success: false,
                            error: `JSON parse error: ${parseError.message}`,
                            rawData: data,
                            latency: latency
                        });
                    }
                });
            });

            req.on('error', (error) => {
                const endTime = process.hrtime.bigint();
                const latency = Number(endTime - startTime) / 1000000;
                resolve({
                    success: false,
                    error: error.message,
                    latency: latency
                });
            });

            req.on('timeout', () => {
                req.destroy();
                const endTime = process.hrtime.bigint();
                const latency = Number(endTime - startTime) / 1000000;
                resolve({
                    success: false,
                    error: 'Request timeout',
                    latency: latency
                });
            });

            req.end();
        });
    }

